import React from "react";

const SobreNosotros = () => {
    return (
        <main style={styles.main}>
            <h1>Sobre Nosotros</h1>
            
        </main>
    );
};

const styles = {
    main: {
        padding: '2rem',
        color: '#fff'
    },
    h1: {
        textAling: 'center'
    }
}

export default SobreNosotros;
